import React from 'react';
import '../../App.css';

export default function Services() {
  return (
  <>
  <h1 className='services'>SERVICES</h1>
  <div class="container">
    <div class="row justify-content-center">
      <div class="col-lg-8 text-center">
  <p className ='normal-text text-center' >We offer delivery on site with the possibility of 
  installation with our sister company ( Capital Asphalt & Interlock)</p>
  </div>
  </div>
  </div>
  </>
  );
}
